function onLinkedInLoad(){IN.Event.on(IN,"auth",onLinkedInAuth),console.log("On auth")}function onLinkedInAuth(){IN.API.Raw("/companies/2414183/updates?event-type=status-update&start=0&count=10&format=json").result(displayCompanyUpdates),console.log("After auth")}function displayCompanyUpdates(e){document.getElementById("displayUpdates");var t="<div class='linkedin-feed-content'>",n=e.values;for(var a in n){var o=n[a].updateContent.companyStatusUpdate.share,i=o.content,s=i,d=i,l=i;if(i)var p=i.title;else p="News headline";o.comment;if(s)var c=i.shortenedUrl;else c="#";if(d)var r=i.description;else r="No description";if(l)var u=i.submittedImageUrl;else u="http://placehold.it/60x60";if(o)t+="<div class='linkedin-feed-post'>"+("<h4 class='linkedin-feed-post-title'><a target='_blank' href='"+c+"'>"+p+"</a></h4><figure><a target='_blank' href='"+c+"'><img src='"+u+"' alt='' class='img-responsive'></a></figure><figcaption><p>"+r+"</p></figcaption>")+"</div>";console.log(o)}t+="</div>",document.getElementById("displayUpdates").innerHTML=t}$(document).ready(function(){$("body").append('<div id="toTop" class="to-top-btn"><i class="fa fa-angle-up"></i></div>'),$(window).scroll(function(){500<$(this).scrollTop()?$("#toTop").fadeIn():$("#toTop").fadeOut()}),$("#toTop").click(function(){return $("html, body").animate({scrollTop:0},600),!1})});